        description: 'Lorem ipsum dolor sit amet, consectetur adipisicing elit. Nobis, vel! Accusantium hic fugiat laudantiu earum consequuntur, unde nam et mollitia eaque incidunt sed.'
    },
    {
        id: 3,
        icon: 'fas fa-plug',
        title: 'Lorem ipsum',
        description: 'Lorem ipsum dolor sit amet, consectetur adipisicing elit. Nobis, vel! Accusantium hic fugiat laudantiu earum consequuntur, unde nam et mollitia eaque incidunt sed.'
    },
    {
        id: 4,
        icon: 'fas fa-desktop',
        title: 'Lorem ipsum',
        description: 'Lorem ipsum dolor sit amet, consectetur adipisicing elit. Nobis, vel! Accusantium hic fugiat laudantiu earum consequuntur, unde nam et mollitia eaque incidunt sed.'
    },
    {
        id: 5,
        icon: 'fas fa-trophy',
        title: 'Lorem ipsum',
        description: 'Lorem ipsum dolor sit amet, consectetur adipisicing elit. Nobis, vel! Accusantium hic fugiat laudantiu earum consequuntur, unde nam et mollitia eaque incidunt sed.'
    },
    {
        id: 6,
        icon: 'fas fa-life-ring',
        title: 'Lorem ipsum',
        description: 'Lorem ipsum dolor sit amet, consectetur adipisicing elit. Nobis, vel! Accusantium hic fugiat laudantiu earum consequuntur, unde nam et mollitia eaque incidunt sed.'
    }
]

function AppServices() {
    return (
        <section id="services" className="block services-block">
            <Container fluid>
                <div className="title-holder">
                    <h2>Our services</h2>
                    <div className="subtitle">services we provide</div>
                </div>
                <Row>
                    {
                        servicesData.map(services => {
                            return (
                                <Col sm={4} className='holder' key={services.id}>
                                    <div className="icon">
                                        <Card>
                                            <i className={services.icon}></i>
                                            <Card.Body>
                                                <Card.Title>{services.title}</Card.Title>
                                                <Card.Text>
                                                    {services.description}
                                                </Card.Text>
                                                <a href={services.title} className="btn btn-primary">Read More <i
                                                    className="fas fa-chevron-right"></i></a>
                                            </Card.Body>
                                        </Card>
                                    </div>
                                </Col>
                            );
                        })
                    }
                </Row>
            </Container>
        </section>
    );
}

export default AppServices;
